	return (
		<Layout>
			<div className="md:flex items-start p-8">
				<div className="flex-1 mr-2">
					<Tasks />
				</div>
				<div className="flex-1 bg-white p-2 ml-4">
					<div className="flex">
						<h2 className="text-lg font-medium text-gray-900">Deals</h2> asd
					</div>

					<MyApex />
				</div>
			</div>
		</Layout>
	);
};
